import './App.css';
import {BrowserRouter,Route} from "react-router-dom";
import DigitalLibrary from './components/Digital Library.jsx';
import Login from './components/Login.jsx';
import Admin from './components/Admin.jsx';
import Student from './components/Student.jsx';
import Borrow from './components/Borrow.jsx';
function App() {
  return (
      <BrowserRouter>
        <div>
        <div class="navbar">
                <ul> 
                    <li style={{float:"left", backgroundColor:"rgb(0, 0, 148)"}}>
                    <a href="/login" onClick="/login" method="POST" target="_blank">Sign In</a></li>
                    <li><a href="#videos">Videos</a></li>
                    <li><a href="#ebooks">E-Books</a></li>
                    <li><a href="#magazines">Magazines</a></li>
                    <li><a href="#books">Books</a></li>
                    <li><a href="#news">News</a></li>
                    <li><a class="active" href="#home">Home</a></li>
                </ul>
            </div>
          <Route exact path="/" component={DigitalLibrary}></Route>
          <Route exact path='/login' component={Login}></Route>
          <Route exact path='/admin' component={Admin}></Route>
          <Route exact path="/student" component={Student}></Route>
          <Route exact path="/borrow" component={Borrow}></Route>
        </div>
      </BrowserRouter>
  );
}

export default App;
